import React from 'react';
import { callReadOnlyFunction } from '@stacks/transactions';
import { StacksMocknet } from '@stacks/network';

const contractAddress = "ST1PQHQKV0RJXZFY1DGX8MNSNYVE3VGZJSRTPGZGM";
const contractName = "sip009-nft";

const FetchLastTokenIdButton = () => {
  const handleClick = async () => {
    const network = new StacksMocknet();
    
    const options = {
      contractAddress,
      contractName,
      functionName: "get-last-token-id",
      network,
      functionArgs: [],
    };

    console.log("Options for callReadOnlyFunction:", options);

    try {
      const result = await callReadOnlyFunction(options);
      console.log("Last token ID result:", result);
    } catch (error) {
      console.error("Error fetching last token ID:", error);
    }
  };

  return (
    <button onClick={() => handleClick()}>
      Fetch Last Token ID
    </button>
  );
};

export default FetchLastTokenIdButton;
